import React from 'react'
import Button from './button'
import Green from '../media/green.png'

export default class task2 extends React.Component {

    constructor(props){
        super(props)
        this.state = {
            sequence: []
        }
    }

    render() {
        return(
            <div>
                <Button image={Green}/>
            </div>
        )
    }

    getNext() {
        return Math.floor(Math.random() * 4);  
    }
}
